
export{Registry}
import{List}from'./list/list.min.js'
import{Form}from'./form/form.min.js'
class Registry{static api='/api/protocol-adapter-registry/protocol-adapters';constructor(ctr){this.list=new List(ctr);this.form=new Form(ctr);}
draw(sp,{pa}){if(!sp&&!pa){return this.list.draw();}
if(sp&&pa&&sp.has('action')&&sp.get('action')==='details'){return this.details.draw(pa);}
if(sp&&!pa&&sp.has('action')&&sp.get('action')==='new'){return this.form.draw();}
if(sp&&pa&&sp.has('action')&&sp.get('action')==='edit'){return this.form.drawEdit(pa);}}}